function transformDateFormat(dateString) {
    var months = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"];
    
    var parts = dateString.split("/");
    if (parts.length === 3) {
        var day = parts[0];
        var month = months[parseInt(parts[1], 10) - 1]; 
        var year = parts[2];
        return `${day}-${month}-${year}`; 
    }
    return dateString; 
}

